script: |
  super -f text -I q10164.spq | sort > q10164.out

inputs:
  - name: q10164.spq
    data: |
      SELECT - 27 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( + + ( - col2 ) ) - + col2 + - - col1 < - 43 * col1 + col2;
  - name: tab2

outputs:
  - name: q10164.out
    data: |
      -27
      -27
      -27
